import React from 'react'

export const Rating = ({rating}) => {
    return (
        <div className='Rating'>
            {
                rating >=1? <i className="bi bi-star-full"></i>
                :rating>=.5?<i className="bi bi-star-half"></i>
                :null
            }

        </div>
    )
}
